      "content": "// SPDX-License-Identifier: Unlicense
pragma solidity 0.8.10;
import "./Ownable.sol";
import "./IBEP20.sol";
import "hardhat/console.sol";

/**
 * @dev Vesting Contract for selected group.
 * It works like as set of configuration, how mutch avaiable token is and what is the period.
 * For withdrawal logic look at the VestingController it is use Vesting Contract to read config.
 **/

contract Vesting is Ownable {
    uint256 public maxAmount;
    IBEP20 public token;
    uint256 public start;
    uint256 public immutable VESTING_PERIOD;
    uint256 public immutable STARTING_PERMYRIAD;
    uint256 public immutable PERIOD_PERMYRIAD;
    uint256 public withdrawn = 0;

    constructor(
        uint256 _maxAmount,
        IBEP20 _token,
        address _owner,
        uint256 _periodPermyriad,
        uint256 _period,
        uint256 _startingPermyriad
    ) {
        token = _token;
        maxAmount = _maxAmount;
        PERIOD_PERMYRIAD = _periodPermyriad;
        VESTING_PERIOD = _period;
        STARTING_PERMYRIAD = _startingPermyriad;
        start = block.timestamp;
        _transferOwnership(_owner);
    }

    // @dev Return how mutch user vault can buy of token
    function amountAvailableToBuy() public view returns (uint256) {
        uint256 amountAlreadyBought = token.balanceOf(address(this)) + withdrawn;
        return maxAmount - amountAlreadyBought;
    }

    /*
        0.8/360 = 0.00(2)
    */
    function amountAvailableToWithdraw() public view returns (uint256) {
        uint256 totalAmount = withdrawn + token.balanceOf(address(this));
        uint256 legalPermyriad = getLegalPermyriad();
        // 1000 * 1010 = 1010000
        // 1010000 / 10000 = 101
        uint256 available = (totalAmount * legalPermyriad) / 10000 - withdrawn;

        return available;
    }

    /** @dev Receive first tokens from controller to vault
     * maximum amount of allocation will be pull from controller and move here
     *
     * Requirements:
     *
     * - `_amount` maxAmount of allocation
     */
    function pull(uint256 amount) public {
        require(amount <= amountAvailableToBuy(), "over-buy-limit");
        token.transferFrom(_msgSender(), address(this), amount);
        emit PullCalled(amount);
    }

    // @dev Compute real Permyriad for vesting
    function getLegalPermyriad() public view returns (uint256) {
        // 1000 + 1 * 10 = 1010
        uint256 permyriad = STARTING_PERMYRIAD + PERIOD_PERMYRIAD * ((block.timestamp - start) / VESTING_PERIOD);

        if (permyriad > 10000) {
            return 10000;
        } else {
            return permyriad;
        }
    }

    // @dev Receive available tokens
    function withdrawAvailable() public {
        uint256 available = amountAvailableToWithdraw();
        withdrawn = withdrawn + available;
        token.transfer(owner(), available);
        emit WithdrawAvailableCalled(available);
    }

    event PullCalled(uint256 amount);
    event WithdrawAvailableCalled(uint256 amount);
}
